import { MdFilterAlt} from 'react/icons/Md'

export default function Home() {
  return (
    <div>
      {/* title */}
      <header className="flex items-center justify-center h-screen shadow-inner 
                         bg-fixed bg-center bg-cover bg-img-lg bg-img-sm sm:pb-36">
        <div className="title-sm title-lg prim-color">
          <h1 className='tracking-wide font-sulangor'>Pemilihan Raya Himakom 2022</h1>
        </div>
      </header>
    </div>
  )
}
